#!/usr/bin/env python3
import base64, marshal, sys

# Embedded marshaled code (base64)
_data_b64 = """"""

def _run():
    raw = base64.b64decode(_data_b64)
    code_obj = marshal.loads(raw)
    # Forward sys.argv like normal script
    saved = sys.argv[:]
    try:
        sys.argv = [saved[0]] + saved[1:]
        exec(code_obj, {'__name__': '__main__'})
    finally:
        sys.argv = saved

if __name__ == '__main__':
    _run()
